import React from 'react';

import styles from './ProjectListItem.module.css';
import projectImage from '../../assets/Python Developer.jpg';

function ProjectListItem(props) {
    return (
    <div className={styles.project} id="project1">
        <p className={styles["project-title"]}>Linkedin Job Scrapper</p>
        <img alt="Project" className={styles["project-img"]} src={projectImage}/>
        <p className={styles["project-tags"]}>Tags: Python, Selenium</p>
    </div>
    );
};

export default ProjectListItem;
